import React from "react";
import ContactCard from "./ContactCard";

const ContactList = (props) => {
  console.log(props);

  const deleteContactHandler = (id) => {
    props.getContactId(id);
  }

  // const contacts =[{id: "1", "name":"Dinesh", "email":"dinesh@gmail.com", "position":"tester"}]


  const renderContactList = props.contacts.map((contact) => {
    return <ContactCard contact={contact} clickHandler={deleteContactHandler} key={contact.id} />;
  });

  return <div className="csmList">
  <h1 className="listHeading">Customer Success Managers </h1>
  <div className="">
    <div className="icon-input">
      <input type="text" placeholder="Search Customer Manager by name or email" className="prompt" />
      <i className="fas fa-search"></i>
    </div>
  </div>
  {renderContactList}
  </div>;
};

export default ContactList;
